    /**
     * Run the database seeds.
     *
     * @return void
     */
    public function run()
    {
        collect($this->party)->each(function ($item) {
            Party::create([
                'id' => $item['partyid'],
                'name' => $item['name'],
                'address' => $item['address'],
                'phone' => $item['phone'],
                'email' => $item['email'],
                'fax' => $item['fax'],
                'type' => $item['type'],
                'parent_id' => !empty($item['parent']) ?: null,
                'black_list' => $item['blacklist'],
            ]);
        });
        collect($this->case_party)->whereIn('party_type', ['plaintiff', 'defendant'])->each(function ($item) {
            $party = Party::create([
                'name' => (\Str::of($item['party_name'])->length == 0) ? $item['party_type'] : $item['party_name'],
                'type' => 'party',
            ]);
        });
        collect($this->case_party)->each(function ($item) {

            if ($item['parentid'] != '0') {
                $partyName = collect($this->case_party)->where('casepartyid', '=', $item['parentid'])->first()['party_name'];
                $subParty = Party::firstWhere('name', $partyName);
            }

            $party = Party::firstWhere('name', $item['party_name']);

            MatterParty::create([
                'party_id' => $party->id,
                'matter_id' => $item['caseid'],
                'type' => $item['party_type'],
            ]);
        });
    }
